data:
  definition: ensemble constitué par plusieurs dispositifs de connexion, sans limitation
    de nombre, isolés les uns des autres, ayant une base commune en matière isolante,
    chacun d'eux comportant ou non un dispositif de fixation et étant susceptible
    d'être facilement dissocié, séparément ou par groupes, des dispositifs voisins
  examples: []
  notes: []
